// DepartmentFactory.sol
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/math/Math.sol";
import "hardhat/console.sol";

contract DepartmentFactory {
    uint private departmentDigits = 16;
    uint private modulus = 10 ** departmentDigits;
    uint private randNonce = 0;


    struct Department {
        uint id;
        string name;
    }


    mapping(uint => Department) public departments;
    mapping(uint=>address) public departmentToOwner;
    mapping(address=>uint[])  public departmentKeys;
    mapping(address=>bytes32) public merkleRoots;

    event departmentCreated(uint id,string name,address indexed owner,bytes32 merkeRoot);



    constructor(){
    }
    function _generateRandomId(string memory _name) view private returns (uint256) {
        uint id = uint(keccak256(abi.encode(_name, randNonce, block.timestamp))) % modulus;
        return id;
    }

    function createDepartment(string memory _name) public returns (Department memory) {
        require(!_departmentExists(_name), "Department has already existed");
        uint id = _generateRandomId(_name);
        departments[id] = Department(id, _name);
        departmentKeys[msg.sender].push(id);
        departmentToOwner[id]=msg.sender;
        generateMerkleRoot(msg.sender);
        emit departmentCreated(id,_name,msg.sender,merkleRoots[msg.sender]);
        return departments[id];
    }

    function getDepartments() public view returns (Department[] memory) {
        Department[] memory result = new Department[](departmentKeys[msg.sender].length);
        for (uint i = 0; i < departmentKeys[msg.sender].length; i++) {
            result[i] = departments[departmentKeys[msg.sender][i]];
            console.log(result[i].id);
            console.log(result[i].name);
        }
        return result;

    }

    function _departmentExists(string memory _name) view private returns (bool) {
        for (uint i = 0; i < departmentKeys[msg.sender].length; i++) {
            if (keccak256(abi.encodePacked(departments[departmentKeys[msg.sender][i]].name)) == keccak256(abi.encodePacked(_name))) {
                return true;
            }
        }
        return false;
    }

    function departmentKeyExists(uint _id,address owner)  view external returns (bool){
        for (uint i = 0; i < departmentKeys[owner].length; i++) {
            if (departmentKeys[owner][i] == _id) {
                return true;
            }
        }
        return false;
    }

    function generateMerkleRoot(address owner)  public {
        uint DepartmentKeysLength = departmentKeys[owner].length;
        if (DepartmentKeysLength == 0) {
            merkleRoots[owner]= 0x0;
            return;
        }
        bytes32[] memory departmentKeyHashes = new bytes32[](departmentKeys[owner].length);
        for (uint i = 0; i < departmentKeys[owner].length; i++) {
            departmentKeyHashes[i] = (keccak256(abi.encodePacked(departmentKeys[owner][i])));
        }

        uint length = departmentKeyHashes.length;
        while (length > 1) {
            uint counter = 0;
            for (uint i = 0; i < length; i += 2) {
                if (i == length - 1) {
                    departmentKeyHashes[counter] = keccak256(abi.encodePacked(departmentKeyHashes[i], departmentKeyHashes[i]));
                } else {
                    departmentKeyHashes[counter] = keccak256(abi.encodePacked(departmentKeyHashes[i], departmentKeyHashes[i + 1]));
                }
                counter++;
            }
            length = counter;
        }
        merkleRoots[owner]=departmentKeyHashes[0];
    }

    function getMerklePath(uint departmentId) public returns (bytes32[] memory){
        bytes32[] memory result = new bytes32[](Math.log2(departmentKeys[msg.sender].length) + 2);
        bytes32[] memory departmentKeyHashes = new bytes32[](departmentKeys[msg.sender].length);
        for (uint i = 0; i < departmentKeys[msg.sender].length; i++) {
            departmentKeyHashes[i] = (keccak256(abi.encodePacked(departmentKeys[msg.sender][i])));
        }
        uint position = _getDepartmentPosition(departmentId, departmentKeyHashes);
        uint counterResult = 0;
        if (position != type(uint).max) {
            uint length = departmentKeyHashes.length;
            while (length > 1) {
                uint counter = 0;
                for (uint i = 0; i < length; i += 2) {
                    if (i == length - 1) {
                        if (position == i) {
                            result[counterResult] = departmentKeyHashes[i];
                            counterResult++;
                        }
                        departmentKeyHashes[counter] = keccak256(abi.encodePacked(departmentKeyHashes[i], departmentKeyHashes[i]));
                    } else {
                        if (position == i) {
                            result[counterResult] = departmentKeyHashes[i + 1];
                            counterResult++;
                        } else if (position == i + 1) {
                            result[counterResult] = departmentKeyHashes[i];
                            counterResult++;
                        }
                        departmentKeyHashes[counter] = keccak256(abi.encodePacked(departmentKeyHashes[i], departmentKeyHashes[i + 1]));
                    }
                    counter++;
                    position = position / 2;
                }
                length = counter;
            }
            result[counterResult] = departmentKeyHashes[0];
        }
        return result;
    }

    function getMerklePathArray(uint[] memory departmentIds,address owner) view external returns (bytes32[][] memory){
        ElementRow[] memory  result=new ElementRow[](departmentIds.length);
        ElementRow[] memory merkleTree=generateMerkleTree(owner);
        bytes32[] memory hashes=merkleTree[0].hashes;
         for(uint i=0;i<departmentIds.length;i++){
             bytes32[] memory merklePath;
             uint keysLength=departmentKeys[owner].length;
             uint exponent=Math.log2(keysLength);
             if(2**exponent==keysLength){
                 merklePath=new bytes32[](Math.log2(departmentKeys[owner].length)+1);
             }else{
                 merklePath=new bytes32[](Math.log2(departmentKeys[owner].length)+2);
             }
             console.log(merklePath.length);
             console.log(merkleTree.length);
             uint merklePathCounter=0;
             uint position=_getDepartmentPosition(departmentIds[i],hashes);
             if(position!= type(uint).max){
                 for(uint j=0;j<merkleTree.length;j++){
                     console.log(merkleTree[j].hashes.length);
                     if(position==merkleTree[j].hashes.length-1){
                         if(position%2==0) {
                             merklePath[merklePathCounter]=merkleTree[j].hashes[position];
                             merklePathCounter++;
                         }
                         else {
                             merklePath[merklePathCounter]=merkleTree[j].hashes[position-1];
                             merklePathCounter++;
                         }

                     }else{
                         if(position%2==0) {
                             merklePath[merklePathCounter]=merkleTree[j].hashes[position+1];
                             merklePathCounter++;
                         }
                         else {
                             merklePath[merklePathCounter]=merkleTree[j].hashes[position-1];
                             merklePathCounter++;
                         }
                     }
                     position=position/2;
                 }
             }
             result[i]=(ElementRow(merklePath));
         }
        return convertToBytesArray(result);
    }
    struct ElementRow {
        bytes32[] hashes;
    }
    function generateMerkleTree(address owner) view public returns (ElementRow[] memory){
        console.log(Math.log2(1));
        ElementRow[] memory merkleTree;
        uint keysLength=departmentKeys[owner].length;
        uint exponent=Math.log2(keysLength);
        if(2**exponent==keysLength){
            merkleTree=new ElementRow[](Math.log2(departmentKeys[owner].length)+1);
        }else{
            merkleTree=new ElementRow[](Math.log2(departmentKeys[owner].length)+2);
        }
//        ||2**(exponent+1)==keysLength+1

        uint DepartmentKeysLength=departmentKeys[owner].length;
        if(DepartmentKeysLength==0) return  new ElementRow[](0);
        bytes32[] memory departmentKeyHashes=new bytes32[](departmentKeys[owner].length);
        for(uint i=0;i<departmentKeys[owner].length;i++){
            departmentKeyHashes[i]=keccak256(abi.encodePacked(departmentKeys[owner][i]));
        }
        merkleTree[0]=ElementRow(departmentKeyHashes);
        uint length=departmentKeyHashes.length;
        uint merkleTreeCount=1;
        while(length>1){
            bytes32[] memory newRow=new bytes32[]((length+1)/2);
            uint counter=0;
            for(uint i=0;i<length;i+=2){
                if(i==length-1){
                   newRow[counter]=keccak256(abi.encodePacked(merkleTree[merkleTreeCount-1].hashes[i],merkleTree[merkleTreeCount-1].hashes[i]));
                }else{
                    newRow[counter] =keccak256(abi.encodePacked(merkleTree[merkleTreeCount-1].hashes[i],merkleTree[merkleTreeCount-1].hashes[i+1]));
                }
                counter++;
            }

            length=counter;
            merkleTree[merkleTreeCount]=(ElementRow(newRow));
            merkleTreeCount++;
        }
        return merkleTree;
    }


    function _getDepartmentPosition(uint departmentId, bytes32[] memory hashes) view private returns (uint){

        for (uint i = 0; i < hashes.length; i++) {
            if (keccak256(abi.encodePacked(departmentId)) == hashes[i]) return i;
        }
        return type(uint).max;
    }

    function departmentKeyListExits(uint[] memory departmentIds,address owner) view external returns (bool){
        for(uint i=0;i<departmentIds.length;i++){
            uint counter=0;
            for(uint j=0;j<departmentKeys[owner].length;j++){
                if(departmentIds[i]==departmentKeys[owner][j]) break;
                counter++;
            }
            if(counter==departmentKeys[owner].length) return false;
        }
        return true;
    }
    function convertToBytesArray(ElementRow[] memory elementRows) public pure returns (bytes32[][] memory) {
        bytes32[][] memory result = new bytes32[][](elementRows.length);
        for (uint i = 0; i < elementRows.length; i++) {
            result[i] = elementRows[i].hashes;
        }
        return result;
    }

    function getDepartmentIdPosition(uint departmentId,address owner) view external returns(uint){
        for(uint i=0;i<departmentKeys[owner].length;i++){
            if(departmentId==departmentKeys[owner][i]) return i;
        }
        return type(uint).max;

    }

    function getDepartmentLength(address owner) external view returns(uint){
        return departmentKeys[owner].length;
    }

    modifier onlyOwner(uint _departmentId){
        require(msg.sender==departmentToOwner[_departmentId]);
        _;
    }


}

contracts/EmployeeFactory.sol.content:
pragma solidity ^0.8.20;

import "./DepartmentFactory.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "hardhat/console.sol";
contract EmployeeFactory {
    uint private employeeDigits = 16;
    uint private modulus = 10 ** employeeDigits;
    uint private randNonce=0;
    uint public employeeMerkleRoot;
    DepartmentFactory public departmentInstance;

    constructor(address _departmentAddress){
        departmentInstance=DepartmentFactory(_departmentAddress);
    }
    struct Employee {
        uint id;
        string name;
        string phoneNumber;
        uint[] departmentIds;
        uint managerId;
        string role;
    }

    mapping(uint  => Employee)  public employees;
    mapping(uint => Employee) public managers;

    mapping(address=>uint[])public  employeeKeys;
    mapping(address=>uint[]) public managerKeys;

    mapping(uint=>address) public employeeToOwner;

    event EmployeeCreated(uint id,string phoneNumber,address indexed owner,string role);
    event EmployeeUpdated(uint indexed id);
    event EmployeeDeleted(uint indexed id);




    function generateEmployee(string memory  _name, string memory  _phoneNumber, uint[] memory _departmentIds, uint _managerId, string  memory _role) public {
        require(!_phoneNumberExists(_phoneNumber), "Phone number exists");
        require(departmentInstance.departmentKeyListExits(_departmentIds,msg.sender),"There is a department that does not exist");
        if (keccak256(abi.encodePacked(_role)) == keccak256(abi.encodePacked("Manager"))) {
            require(!(_managerId>0),"Error");
            uint id = _generateRandomId(_phoneNumber);
            employees[id] = Employee(id, _name, _phoneNumber, _departmentIds, _managerId, _role);
            employeeKeys[msg.sender].push(id);
            managers[id] = employees[id];
            managerKeys[msg.sender].push(id);
            employeeToOwner[id]=msg.sender;
            emit EmployeeCreated(id,_phoneNumber,msg.sender,_role);
        } else if (keccak256(abi.encodePacked(_role)) == keccak256(abi.encodePacked("Employee"))) {
            if(_managerId>0)   require(_managerExists(_managerId), "Don't exists the manager ");
            uint id = _generateRandomId(_phoneNumber);
            employees[id] = Employee(id, _name, _phoneNumber, _departmentIds, _managerId, _role);
            employeeKeys[msg.sender].push(id);
            employeeToOwner[id]=msg.sender;
            emit EmployeeCreated(id,_phoneNumber,msg.sender,_role);
        }
    }
    function deleteEmployee(uint _employeeId) public onlyOwner(_employeeId)  {
        uint indexToDelete=type(uint).max;
        for(uint i=0;i<employeeKeys[msg.sender].length;i++){
            if(employeeKeys[msg.sender][i]==_employeeId){
                indexToDelete=i;
                break;
            }
        }

        require(indexToDelete!=type(uint).max,"The employee does not exist");
        if(keccak256(abi.encode(employees[_employeeId].role))==keccak256(abi.encode("Manager"))){
            uint indexToDeleteManager=0;
            for(uint i=0;i<employeeKeys[msg.sender].length;i++){
                if(employees[employeeKeys[msg.sender][i]].managerId == _employeeId){
                    employees[employeeKeys[msg.sender][i]].managerId=0;
                }
            }
            for(uint i=0;i<managerKeys[msg.sender].length;i++){
                if(managerKeys[msg.sender][i]== _employeeId){
                    indexToDeleteManager=i;
                }
            }
            managerKeys[msg.sender][indexToDeleteManager]=managerKeys[msg.sender][managerKeys[msg.sender].length-1];
            managerKeys[msg.sender].pop();
        }
        delete employees[indexToDelete];
        employeeKeys[msg.sender][indexToDelete]=employeeKeys[msg.sender][employeeKeys[msg.sender].length -1];
        employeeKeys[msg.sender].pop();
        emit EmployeeDeleted(_employeeId);
    }

    function getEmployees() public view  returns (Employee[] memory){
        Employee[] memory result=new Employee[](employeeKeys[msg.sender].length);
        for (uint i = 0; i < employeeKeys[msg.sender].length; i++) {
            result[i] = employees[(employeeKeys[msg.sender])[i]];
        }
        return result;
    }

    function updateEmployee(uint _employeeId,string memory _name,string memory _phoneNumber,uint[] memory _departmentIds,uint _managerId,string  memory _role) public onlyOwner(_employeeId) {
        require(_employeeExists(_employeeId),"Employee does not exists");
        if(bytes(_phoneNumber).length> 0){
            require(!_phoneNumberExists(_phoneNumber),"Phone number exists");
            employees[_employeeId].phoneNumber=_phoneNumber;
        }

        if(bytes(_name).length>0) employees[_employeeId].name=_name;
        if(_managerId>0){
            require(_managerExists(_managerId) && keccak256(abi.encodePacked(_role))!=keccak256(abi.encodePacked("Manager")),"Manager does not exists");
            if(keccak256(abi.encodePacked(employees[_employeeId].role))==keccak256(abi.encodePacked("Manager"))){
                require(keccak256(abi.encodePacked(_role))==keccak256(abi.encodePacked("Employee")),"");
            }
        }else{
            employees[_employeeId].managerId=_managerId;
        }
        if(_departmentIds.length!=0){
            require(departmentInstance.departmentKeyListExits(_departmentIds,msg.sender),"There is a department that does not exist");
            employees[_employeeId].departmentIds=_departmentIds;
        }
        if(bytes(_role).length>0){
            require(keccak256(abi.encodePacked(_role))==keccak256(abi.encodePacked("Manager")) ||keccak256(abi.encodePacked(_role))==keccak256(abi.encodePacked("Employee")),"The role does not exist" );
            bytes32 roleHash=keccak256(abi.encodePacked(employees[_employeeId].role));
            bytes32 _roleHash=keccak256(abi.encodePacked(_role));
            bytes32 managerHash=keccak256(abi.encodePacked("Manager"));
            bytes32 employeeHash=keccak256(abi.encodePacked("Employee"));
            if(roleHash==managerHash && _roleHash==employeeHash){
                uint indexToDeleteManager=0;
                for(uint i=0;i<employeeKeys[msg.sender].length;i++){
                    if(employees[(employeeKeys[msg.sender])[i]].managerId == _employeeId){
                        employees[(employeeKeys[msg.sender])[i]].managerId=0;
                    }
                }
                for(uint i=0;i<managerKeys[msg.sender].length;i++){
                    if(managerKeys[msg.sender][i]== _employeeId){
                        indexToDeleteManager=0;
                    }
                }
                managerKeys[msg.sender][indexToDeleteManager]=managerKeys[msg.sender][managerKeys[msg.sender].length-1];
                managerKeys[msg.sender].pop();
            }
            employees[_employeeId].role=_role;
            if(roleHash==managerHash){
                managerKeys[msg.sender].push(_employeeId);
            }

        }
        emit EmployeeUpdated(_employeeId);

    }

    function verifyDepartment(uint[] memory departmentIds) public returns (string memory){
        bytes32[][]  memory merklePathArray=departmentInstance.getMerklePathArray(departmentIds,msg.sender);
        for(uint i=0;i<merklePathArray.length;i++){
            bytes32 hash=keccak256(abi.encodePacked(departmentIds[i]));
            uint length=merklePathArray[i].length;
            uint position=departmentInstance.getDepartmentIdPosition(departmentIds[i],msg.sender);
            for(uint j=0;j<length-1;j++){
                if(position%2==0) hash=keccak256(abi.encodePacked(hash,merklePathArray[i][j]));
                else hash=keccak256(abi.encodePacked(merklePathArray[i][j],hash));
                position=position/2;
            }
            console.logBytes32(hash);
            console.logBytes32(merklePathArray[i][length-1]);
            if(hash!=merklePathArray[i][length-1]) return "0";
        }
        console.log("It is right");
        return "1";

    }

    function _generateRandomId(string memory _phoneNumber) private returns (uint){
        uint id = uint(keccak256(abi.encodePacked(_phoneNumber,randNonce,block.timestamp))) % modulus;
        randNonce++;
        return id;
    }

    function _phoneNumberExists(string memory _phoneNumber) view private returns (bool){
        bytes32 phoneHash=keccak256(abi.encodePacked(_phoneNumber));
        for (uint i = 0; i < employeeKeys[msg.sender].length; i++) {
            if (keccak256(abi.encodePacked(employees[employeeKeys[msg.sender][i]].phoneNumber)) == phoneHash) {
                return true;
            }
        }
        return false;
    }

    function _managerExists(uint _id)  view private returns (bool){
        for (uint i = 0; i < managerKeys[msg.sender].length; i++) {
            if (managerKeys[msg.sender][i] == _id) {
                return true;
            }
        }
        return false;
    }

    function _employeeExists(uint _id) view private returns (bool){
        for (uint i = 0; i < employeeKeys[msg.sender].length; i++) {
            if ((employeeKeys[msg.sender])[i] == _id) {
                return true;
            }
        }
        return false;
    }
    modifier onlyOwner(uint _employeeId){
        require(msg.sender==employeeToOwner[_employeeId]);
        _;
    }

}

